import React from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import Icon from 'react-icons-kit';
import {arrows_plus} from 'react-icons-kit/linea/arrows_plus';
import TextField from '@material-ui/core/TextField';

class NewBranchDialogue extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      NewBranchName: '',
      SourceBranch: 'master',
      open: false,
    }
    this.handleChange=this.handleChange.bind(this);
    this.handleSubmit=this.handleSubmit.bind(this);
    this.handleKeyPress=this.handleKeyPress.bind(this);
  }

  handleChange(e) {
    this.setState({NewBranchName:e.target.value})
  }

  handleSubmit(e) {
    e.preventDefault();
    this.props.newBranch(this.state.SourceBranch, this.state.NewBranchName);
    this.setState({ open: false });
  }


  handleClickOpen  ()  {
    this.setState({ open: true });
  };

  handleClose  ()  {
    this.setState({ open: false });
  };

  handleKeyPress(e){
    if(e.key === 'Enter'){
      this.handleSubmit();
    }
  }

  render() {
    return (
      <div className="NewBranchButton">
        <Button onClick={this.handleClickOpen} className="Button"><Icon icon={arrows_plus} size={25}/></Button>
        <Dialog
          open={this.state.open}
          onClose={this.handleClose}
          aria-labelledby="alert-dialog-title"
          aria-describedby="alert-dialog-description"
        >
          <DialogContent>
            <TextField
              id="branchname-input"
              label="New branch name"
              value={this.state.NewBranchName}
              onChange={this.handleChange}
              onKeyPress={(e)=>{this.handleKeyPress(e)}}
              fullWidth
              margin="normal"
            />
          </DialogContent>
          <DialogActions>
            <Button color="secondary" onClick={this.handleClose}>Cancel</Button>
            <Button color="primary" onClick={this.handleSubmit}>Submit</Button>
          </DialogActions>
        </Dialog>
      </div>
    );
  }
}

export default NewBranchDialogue;
